import React, {Component} from "react";
import "../App.css";
import logo from  '../logo_biblioteca.jpg';

class top_bar extends Component{
    render(){
        return <div className='logo'><img src={logo} width='65' alt= 'Logo'/></div>
    }
}
    






export default Component;
